int main(void)
{
  /* STM32F4xx HAL library initialization:
       - Configure the Flash prefetch, instruction and Data caches
       - Configure the Systick to generate an interrupt each 1 msec
       - Set NVIC Group Priority to 4
       - Global MSP (MCU Support Package) initialization
     */
  HAL_Init();

  /* Configure the system clock to 168 MHz */
  SystemClock_Config();

  /* Configure LED3 and LED4 */
  BSP_LED_Init(LED3);
  BSP_LED_Init(LED4);


  /*##-1- LCD Initialization #################################################*/
  /* Initialize the LCD */
  BSP_LCD_Init();
  BSP_GYRO_Init();

//  if (BSP_GYRO_Init() != GYRO_OK)
//    {
//      BSP_LCD_SetBackColor(LCD_COLOR_WHITE);
//      BSP_LCD_SetTextColor(LCD_COLOR_RED);
//      BSP_LCD_DisplayStringAt(0, BSP_LCD_GetYSize()- 95, (uint8_t*)"ERROR", CENTER_MODE);
//      BSP_LCD_DisplayStringAt(0, BSP_LCD_GetYSize()- 80, (uint8_t*)"MEMS cannot be initialized", CENTER_MODE);
//    }

  /* Layer2 Init */
  BSP_LCD_LayerDefaultInit(1, LCD_FRAME_BUFFER_LAYER1);
  /* Set Foreground Layer */
  BSP_LCD_SelectLayer(1);
  /* Clear the LCD */
  BSP_LCD_Clear(LCD_COLOR_WHITE);
  BSP_LCD_SetColorKeying(1, LCD_COLOR_WHITE);
  BSP_LCD_SetLayerVisible(1, DISABLE);

  /* Layer1 Init */
  BSP_LCD_LayerDefaultInit(0, LCD_FRAME_BUFFER_LAYER0);

  /* Set Foreground Layer */
  BSP_LCD_SelectLayer(0);

  /* Enable The LCD */
  BSP_LCD_DisplayOn();

  /* Clear the LCD */
  BSP_LCD_Clear(LCD_COLOR_GRAY);
  
  int i = 0;

//  /* Infinite loop */
  BSP_GYRO_Reset();
  BSP_LCD_Clear(LCD_COLOR_GRAY);
  draw_hole();
  draw_screen();

  while (1)
    {
	  BSP_GYRO_GetXYZ(buffer);

//	sprintf(xval, "%f", buffer[0]);
//	sprintf(yval, "%f", buffer[1]);
//	sprintf(zval, "%f", buffer[2]);
	  
//	xval = buffer[0];
//	yval = buffer[1];
//	zval = buffer[2];
//	BSP_LCD_DisplayStringAtLine(1, (uint8_t*) xval);
//  BSP_LCD_DisplayStringAtLine(2, (uint8_t*) yval);
//  BSP_LCD_DisplayStringAtLine(3, (uint8_t*) zval);
    HAL_Delay(50);
  }
}

